import {useState} from "react"

function Home (){
    return <div>Home</div>
}


function Contador(){
    const [contador,setContador] = useState(1);


    function adicionarCount(){
        setContador(contador + 1)
    }

    return(
        <div>
            <div>{contador}</div>
            <button onClick={adicionarCount}></button>
        </div>
    )
}



export default Home
